import React from 'react';
import PopupWithForm from './PopupWithForm';

function PopupWithConfirmation({ isOpen, onClose }) {
  function handleCardDelete(e) {
    e.preventDefault();
  }

  return (
    <PopupWithForm
      name="confirm"
      title="Вы уверены?"
      submit="Да"
      isOpen={isOpen}
      onClose={onClose}
      onSubmit={handleCardDelete}
    />
  );
}

export default PopupWithConfirmation;
